import React from 'react';
import './style.css';
import Card from '../../components/UI/Card';


const Home = props =>{

  const galleryHeight = 450;
  const galleryStyle = {
    height: galleryHeight+'px',
    overflow:'hidden'
}

  const sideImageHeight = galleryHeight /3;
  return (
    <div>
      <Card>
        <div className="galleryPost" style={galleryStyle}>
         <section style = {{width:'70%'}}>
           <div>
              <img src = {'https://media.gettyimages.com/photos/go-be-alone-with-your-thoughts-picture-id691829054?k=6&m=691829054&s=612x612&w=0&h=x2P9Ku8rfNgAiPg4givt3DMKNIrZZ0bzskPLWvkEd50='}/>
           </div>
         </section>

         <section style={{width:'30%'}}>
         <div style ={{height:`${sideImageHeight}px` }}>
              <img src = {'https://media.gettyimages.com/photos/hippie-woman-stroll-on-mountain-picture-id612619528?k=6&m=612619528&s=612x612&w=0&h=oZ7Q5K0SF_zmy-YWEgUaWbNjfERUlto9kmnEYlLSGqo='} alt=""/>
           </div>
           <div>
              <img src = {'data:image/jpeg;base64,'} alt=""/>
           </div>
           <div>
              <img src = {'https://media.gettyimages.com/photos/finishing-her-job-picture-id695485366?k=6&m=695485366&s=612x612&w=0&h=_RK4ln1GUF6XL8mp5z-JbHxjGuWtm8WW1OjbeKBv57k='} alt=""/>
           </div>
         </section>
        </div>

      </Card>
    </div>
  );
}

export default Home;
